import React from "react";

const NewBlog = ({ blog }) => {
  console.log(blog);
  const { que, details } = blog;
  return (
    <div className="p-4 ">
      <h2>{que}</h2>
      <p>{details}</p>
    </div>
  );
};

export default NewBlog;
